import React from 'react'
import MoreVertIcon from '@mui/icons-material/MoreVert';

import Search from './Search'
import Options from '../general/Options';

export default function SideBarHeader({ openModal, isMobile, openSettings, openProfile, toggleAddChatModal, logout }) {

    const getOptions = () => {
        return [
            {
                label: 'Settings',
                action: openSettings
            },
            {
                label: 'Profile',
                action: openProfile
            },
            {
                label: 'Add chat',
                action: toggleAddChatModal
            },
            {
                label: 'logout',
                action: logout
            }
        ]
    }
    return (
        <header className="side-bar-header flex">
            <h1>chatMe</h1>
            {isMobile && <Search />}
            <div className='options-container-sidebar-header'>
                <button className='options-btn'><MoreVertIcon /></button>
                <Options options={getOptions()} />
            </div>
            {/* <button onClick={openModal} className="new-chat-btn">+</button> */}
        </header>
    )
}
